INSERT INTO `dept_desc` (`id`, `dept_id`, `photo_name`, `dept_description`) VALUES
(19, 26, '1.jpg|2.jpg|3.jpg|4.jpg|5.jpg|6.jpg|7.jpg|8.jpg', '<p>Anthropology is the study of people throughout the world, their evolutionary history, how they behave, adapt to different environments, communicate and socialise with one another. The study of anthropology is concerned both with the biological features that make us human (such as physiology, genetic makeup, nutritional history and evolution) and with social aspects (such as language, culture, politics, family and religion). Whether studying a religious community in London, or human evolutionary fossils in the UAE, anthropologists are concerned with many aspects of peoples lives: the everyday practices as well as the more dramatic rituals, ceremonies and processes which define us as human beings. A few common questions posed by anthropology are: how are societies different and how are they the same? how has evolution shaped how we think? what is culture? are there human universals? By taking the time to study peoples lives in detail, anthropologists explore what makes us uniquely human. In doing so, anthropologists aim to increase our understanding of ourselves and of each other.</p>');
