INSERT INTO `noticeboard` (`id`, `notice_subject`, `notice`, `publish_dt`) VALUES
(236, 'Seat Booking for 3rd and 4th Semester BCom H&G', '<p><span style=\"color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: medium; background-color: #f9f9f9;\">Students of 3</span><span style=\"box-sizing: border-box; font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; background-color: #f9f9f9;\">rd</span><span style=\"color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: medium; background-color: #f9f9f9;\">&nbsp;and 4th Semester of BCom Hons and Gen are hereby asked to collect the Admission Form from the college office and deposit Seat booking Fees of Rs 700/- through the webpage after putting the Application No from the Admission Form and submit both paid challan and Duly filled up Admission Form to the college office within 20</span><span style=\"box-sizing: border-box; font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; background-color: #f9f9f9;\">th</span><span style=\"color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: medium; background-color: #f9f9f9;\">&nbsp;August 2018.</span></p>', '2018-08-02'),
(238, 'Seat Booking for 2nd Yr BA/BSc/BCom Hons and Gen (Annual system) ', '<p><span style=\"color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: medium; background-color: #f9f9f9;\">Students of 2nd</span><span style=\"color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: medium; background-color: #f9f9f9;\">&nbsp;Yr BA/BSc/BCom Hons and Gen&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">(Annual system)&nbsp;</span><span style=\"color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: medium; background-color: #f9f9f9;\">are hereby asked to collect the Admission Form from the college office and deposit Seat booking Fees of Rs 700/- through the webpage after putting the Application No from the Admission Form and submit both paid challan and Duly filled up Admission Form to the college office from 16th August 2018 to 7th September</span><span style=\"color: #555555; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: medium; background-color: #f9f9f9;\"> 2018.</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\"><br /></span></p>', '2018-08-31'),
(254, 'M. Sc Mathematics (PG) Admission Notice (4)', '<p class=\"MsoNormal\" style=\"margin: 16.75pt 0in; line-height: 29.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-origin: initial; background-clip: initial; font-size: 11pt; font-family: Calibri,sans-serif;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 21pt; font-family: Arial,sans-serif; color: #48cfad;\">&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 8.35pt; line-height: 18.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-origin: initial; background-clip: initial; font-size: 11pt; font-family: Calibri,sans-serif;\"><span style=\"font-size: 11.5pt; font-family: Arial,sans-serif; color: #797979;\">Date of admission of 3rd Selection list Part- &lsquo;A and Part B</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 8.35pt; line-height: 18.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-origin: initial; background-clip: initial; font-size: 11pt; font-family: Calibri,sans-serif;\"><span style=\"font-size: 11.5pt; font-family: Arial,sans-serif; color: #797979;\"><br /> The following should be followed on <strong>4-7, September 2018</strong> for PG admission 2018 for&nbsp;<a href=\"https://www.rediffmail.com/cgi-bin/red.cgi?red=https%3A%2F%2Fwww%2Erediffmail%2Ecom%2Fcgi%2Dbin%2Fred%2Ecgi%3Fred%3Dhttp%3A%2F%2FM%2ESc%26amp%3BisImage%3D0%26amp%3BBlockImage%3D0%26amp%3Brediffng%3D0%26amp%3Brdf%3DBCJUNwduBGsBNQQyAQ1XYAc8AmdYdwNy%26amp%3Brogue%3Daa061525b216966658743ed7828fb1de46139cbb&amp;isImage=0&amp;BlockImage=0&amp;rediffng=0&amp;rogue=52da608fa4e1827da1db2d8a7b630aa6f6725d3e&amp;rdf=BSMDYAhhXzBcaFNlAAxWYVBrBGEALwV0\" target=\"_blank\" rel=\"external\"><span style=\"color: #444e67; text-decoration-line: none;\">M.Sc</span></a>&nbsp;Mathematics&nbsp; department:&nbsp;<br /> <br /> 1. Time of reporting for candidates is between 5 a pm to 7 pm to the department.&nbsp;<br /> It should be noted&nbsp; that candidates reporting beyond the given time will not&nbsp; be entertained.&nbsp;<br /> 2. Documents to be submitted at the time of admission:&nbsp;<br /> a. Print Copy of Application Form.&nbsp;<br /> b. Attested stamp &ndash; size photographs &ndash; 3 copies.&nbsp;<br /> c. Original Mark sheet of the candidate.&nbsp;<br /> d. Copy of Aadhar Card&nbsp;<br /> e. Demand Draft of Rs. 16,500/- in favour of &ldquo;Bangabasi Evening College M Sc Mathematics&rdquo; Payable at Kolkata as admission fees.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 8.35pt; line-height: 18.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-origin: initial; background-clip: initial; font-size: 11pt; font-family: Calibri,sans-serif;\"><span style=\"font-size: 11.5pt; font-family: Arial,sans-serif; color: #797979;\">For father details please Contact: Coordinator PG section (mobile no. 9239031580)</span></p>', '2018-09-04'),
