ine-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 24.0pt; line-height: 115%; font-family: \'Courier New\';\">Notice For B.A./B.Sc. semester-I</span></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; line-height: 115%; font-family: \'Courier New\';\">Online form fill-up for BA/BSc Semester-I (CBCS) C.U Examination-2018 will start from 19/11/2018 to 24/11/2018.</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Courier New\';\">All 1<sup>st</sup> year B.A./B.Sc. (Hons &amp; Gen) regular students who are appearing in the B.A./B.Sc. Semester-I C.U examination-2018 are informed to submit their examination form an online Web site. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; line-height: 115%; font-family: \'Courier New\';\">Web site: cuexam.net</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Courier New\';\">After entering the site go to student option and put the Registration number (to be collected from 1<sup>St</sup> floor office) in the given box. The form will appear with your details. Check the form (Photo, Name, Subject etc) and take print out and meet 1<sup>St</sup> floor office.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\">Note:</span></strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\"> All candidates are asked to bring with them Registration candidate copy, Registration Certificate, Fees books, Library clearance. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 26.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Bradley Hand ITC\';\">&nbsp;</span></strong></p>', '2018-11-19'),
(308, 'Holiday', '<p>The College will remain closed on 21st and 23rd November 2018 on account of Fateh Doaz Dahum and Guru Nanak\'s Birthday respectively</p>', '2018-11-20'),
