b site: cuexam.net</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 14.0pt; font-family: \'Courier New\'; mso-ansi-language: EN-IN; mso-fareast-language: EN-IN;\">After entering the site go to student option and put the Registration number (to be collected from 1<sup>St</sup> floor office) in the given box. The form will appear with your details. Check the form (Photo, Name, Subject etc) and take print out and meet 1<sup>St</sup> floor office.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; text-align: justify; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Courier New\'; mso-ansi-language: EN-IN; mso-fareast-language: EN-IN;\">Note:</span></strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Courier New\'; mso-ansi-language: EN-IN; mso-fareast-language: EN-IN;\"> All candidates are asked to bring with them Registration candidate copy, Registration Certificate, Fees books. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 18.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">&nbsp;</span></p>', '2018-11-26'),
