pan style=\"color: #1f497d; mso-themecolor: text2;\">9830158191</span>) from October 9, 2018 during 5-8 pm.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; margin-bottom: .0001pt; line-height: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Qualification: HS or equivalent</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; margin-bottom: .0001pt; line-height: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Course Fees : Rs 1000/- per semester</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; margin-bottom: .0001pt; line-height: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Candidates must submit the following documents to the Office (to Sri Ujjal Banerjee <span style=\"color: #1f497d; mso-themecolor: text2;\">9830122617</span>) within 12.10.18</span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; tab-stops: 261.5pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-IN;\">1.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Duly filled up on line admission form by ink (Hard Copy)</span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; tab-stops: 261.5pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; ms