: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; mso-fareast-language: EN-IN;\">Pay Admission Fees Online</span></a></span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-themecolor: text1; mso-fareast-language: EN-IN;\">&rsquo; above the page, </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">then by clicking <span style=\"color: #376092;\">&ldquo;<span style=\"text-decoration: underline;\">1st Year Admission Form</span>&rdquo;, </span>it may be also paid by card</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-IN;\">; </span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; tab-stops: 261.5pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-IN;\">6.&nbsp;&nbsp;&nbsp;&nbsp; Xerox Cast certificate for SC/ST/OBC candidates, if any; </span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; tab-stops: 261.5pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-IN;\">7.&nbsp;&nbsp;&nbsp;&nbsp; Copy of Aadhar Card</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 18.0pt; line-height: normal;\"><span lang=\"EN-US\" style=\"fo