ft:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">&nbsp;</span></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Courier New\';\">All 3<sup>rd</sup> year B.A/B.Sc/B.Com (Hons and General) regular and casual students who are appearing in the C.U Examination 2019 are informed to submit their examination form online&nbsp;</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Courier New\';\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"> from: 02.02.2019 to 07.02.2019</span></span></strong>.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Courier New\';\">Web site: </span></strong><a href=\"http://www.cuexam.net\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Courier New\';\">www.cuexam.net</span></strong></a></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Courier New\';\">After entering the site go to student option and put the Registration number in box. The form will appear with your all details, check the form (Photo, Name, Subjects etc)and take print out and meet 1<sup>St</sup> floor office.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Courier New\';\">Note:</span></span></strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Courier New\';\"> 1) All candidates are asked to bring with their Registration certificate, Fees books, Library clearance, Tuition fees paid up to June 2019.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%; tab-stops: 42.55pt;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Courier New\';\">2) It may be noted that if any student(s) unable to submit CU Form to the college office <span style=\"text-decoration: underline;\">within schedule</span>, the college authority will not be responsible for not approval. After last date, the college authority unable to approved their candidature through CU website portal.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 22.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Algerian;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>', '2019-01-18'),
(348, 'Urgent Notice BA BSc and BCom (Hons & Gen) 3rd Yr (1+1+1system)', '<p>&nbsp;</p>\r\n<p>All the Students of BA, BSc and BCom (Hons &amp; Gen) 3rd Yr (1+1+1system) are instructed to deposit their fees and session charges (dues, if any up to 30<sup>th</sup> June 2019) within 31<sup>st</sup> January 2019. On Line Form fill up for University Exam will start from 2nd February 2019 to 7th February 2019. For any quiry contact with Sri Ujjal Banerjee and sri Sanjeet Kr Singh.</p>', '2019-01-18'),
(349, 'Holiday', '<p>The College will remain closed from 23rd to 26th January 2019 on account of Netaji Birthday, Calcutta University Foundation day, Maghi Utsab and Republic day respectively.</p>', '2019-01-22'),
(350, 'BA/BSc PT I Hons and Gen Exam 2018 (1+1+1)Mark-sheet ', '<p>&nbsp;</p>\r\n<p>BA/BSc PT I Hons and Gen Exam 2018 (1+1+1)Mark-sheet will be issued from 29.01.19 from 1st Floor office. </p>', '2019-01-25'),
