(355, 'B.A/B.Sc/B.COM ONLINE FORM FILL-UP FOR C.U PART-I SUPPLEMENTARY EXAMINATION, 2018', '<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Courier New\';\">This is to notify that the all students who have already appeared or due to appear at the part &ndash; III Examination are eligible to seat the <strong style=\"mso-bidi-font-weight: normal;\">Part&ndash;I Supplementary Examination</strong>, in their failed General Subjects. The said candidates are directed to note that their Form fill-up of Supplementary Examination, 2018 will start from 5.2.19 to 8.2.19.<br /></span></p>', '2019-02-01'),
(357, 'Admit Card for BA BSc BCom Part II Supp (1+1+1 syst)', '<p>&nbsp;</p>\r\n<p><span lang=\"EN-US\" style=\"font-size: 20.0pt; mso-bidi-font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-language: EN-IN;\">Admit Card for for BA BSc BCom Part II Supplementary (1+1+1system) will be issued from the college office on 12.2.19 (Tuesday). The exam will commence from 13.2.19 (Thursday).<br /></span></p>', '2019-02-11'),
(358, 'Admit Card for BA BSc BCom Part I Supp (1+1+1 syst)   ', '<p>&nbsp;</p>\r\n<p><span lang=\"EN-US\" style=\"font-size: 20.0pt; mso-bidi-font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-language: EN-IN;\">Admit Card for BA BSc BCom Part I Supplementary (1+1+1system) will be issued from the college office on 21.2.19 (Thursday). The exam will commence from 26.2.19 (Tuesday).</span></p>', '2019-02-20');
