t-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">Web site: </span></strong><a href=\"http://www.cuexam.net\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">www.cuexam.net</span></strong></a></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">After entering the site go to student option and put the Registration number in box. The form will appear with your all details, check the form (Photo, Name, Subjects etc) and take print out and meet 1<sup>St</sup> floor office.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">Note:</span></span></strong><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">1) All candidates are asked to bring with their Registration certificate, Fees books, Library clearance, Tuition fees paid up to June 2019.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%; tab-stops: 42.55pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">2) It may be noted that if any student(s) unable to submit CU Form to the college office <span style=\"text-decoration: underline;\">within schedule</span>, the college authority will not be responsible for not approval. After last date, the college authority unable to approved their candidature through CU website portal.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'Bookman Old Style\',\'serif\';\">&nbsp;</span></p>', '2019-03-09'),
