-family: \'Courier New\'; mso-fareast-font-family: \'Times New Roman\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Bookman Old Style\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Courier New\';\">Web site: </span></strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\"><a href=\"http://www.cuexam.net\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\'; color: blue;\">www.cuexam.net</span></strong></a></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Bookman Old Style\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Courier New\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Courier New\';\">After entering the site go to student option and put the Registration number in box. The form will appear with your all details, check the form (Photo, Name, Subjects etc) and take print out and meet 1<sup>St</sup> floor office.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; text-align: justify; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Bookman Old Style\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Courier New\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 14.2pt; text-align: justify; line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Courier New\';\">Note:</span></span></strong><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Courier New\';\">1) All candidates are asked to bring with their Registration certificate, Fees books, Library clearance, Tuition fees paid up to June 2019.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; line-height: 150%; tab-stops: 42.55pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Courier New\';\">2) It may be noted that if any student(s) unable to submit CU Form to the college office <span style=\"text-decoration: underline;\">within schedule</span>, the college authority will not be responsible for not approval. After last date, the college authority unable to approved their candidature through CU website portal.</span></p>', '2019-03-16'),
(365, 'Holiday', '<p class=\"MsoNormal\">The College will remain closed on 21<sup>st</sup> and 22<sup>nd</sup> March 2019 on account of Dolyatra and Holi. The college will also remain closed on 23rd March 2019 on account of pipeline repairing of drinking water supply.</p>', '2019-03-19'),
