(368, 'B.Com Part â€“ III Hons Admit Card', '<p><span lang=\"EN-US\" style=\"font-size: 18.0pt; font-family: \'Bookman Old Style\',\'serif\';\">All Students of B.Com Part &ndash; III Hons (Under 1+1+1 System) are instructed that their Admit Card is to be collected on 29.03.2019 from 1<sup>st</sup> floor office for exam on 3.4.19.</span></p>', '2019-03-27'),
(369, '.BA/BSc Part â€“ III Hons Admit Card', '<p>&nbsp;</p>\r\n<p><span lang=\"EN-US\" style=\"font-size: 18.0pt; font-family: \'Bookman Old Style\',\'serif\';\">All Students of BA/BSc Part &ndash; III Hons (Under 1+1+1 System) are informed that their Admit Card would be issued on 29.03.2019 from 1<sup>st</sup> floor office for their exam starting on 2.4.19.</span></p>', '2019-03-28');
