(380, 'Online submission of application form of BA/BSc/B.Com Part II Hons and General (1+1+1 system) extended', '<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">Online submission of application form with requisite fees of BA/BSc/B.Com Part II Hons and General (1+1+1 system) who are appearing in the C.U Examination 2019 are informed that the date have been extended for<strong> 2 days</strong></span><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">: 2.5.19 and 3.5.19.</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">Web site: </span></strong><a href=\"http://www.cuexam.net\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: \'Courier New\';\">www.cuexam.net</span></strong></a></p>\r\n<p>&nbsp;</p>', '2019-04-30'),
(381, 'College Closed', '<p>The college will remain closed today (on 3.5.19) due to storm (&lsquo;Fani&rsquo;). The altered dates of Theoretical and Practical exams will be announced shortly. Students of Part II BA/BSc/BCom Hons and Gen those who were scheduled to fill up their form in the last extended date (today) should contact Sri Ujjal Banerjee (mob 9830122617) immediately.</p>', '2019-05-03'),
(382, 'Admit Cards of 3rd yr BA/BSc/BCom (Gen) 1+1+1 system', '<p><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Admit Cards of 3rd yr</span></strong> BA/BSc/BCom (Gen) 1+1+1 system for CU exam 2019&nbsp; is being issued from 1<sup>st</sup> floor office on 7th 8th and 10th May 2019 from the college office.</span></strong></p>', '2019-05-06'),
(383, 'Holiday', '<p>The college will remain closed on 9.5.19 on account of Rabindrajayanti.&nbsp;</p>', '2019-05-10');
