hed on 10.6.19. Admission will commence from 12.6.19.<br /></span></p>', '2019-05-28'),
(397, 'Admit Cards of 2nd yr BA/BSc (Hons and Gen) 1+1+1 system', '<p>&nbsp;</p>\r\n<p><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Admit Cards of 2nd yr BA/BSc (Hons and Gen) 1+1+1 system</span></strong> for CU exam 2019&nbsp; is being issued from 1<sup>st</sup> floor office on from30.5.19 to 1.6.19 from the college office.</span></strong></p>', '2019-05-30');
