di-font-size: 11.0pt; line-height: 115%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">The candidates who have received the call letters for Group-C LD Clerk and Library Clerk posts are hereby informed that </span>Written Exam for the same will be held at Room No 213 and 214 on 1.6.19. </span></strong><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 24.0pt; mso-bidi-font-size: 20.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;\">from11.00AM to 1.00PM, (Candidate must report at 10.30 AM) <span style=\"mso-bidi-font-weight: bold;\">Written Examination is set for 150 marks, comprising of Mathematics, English and Mental aptitude, based on multiple choice questions (MCQ). </span>The candidate must bring the age proof certificate (original), pass certificates and testimonials (original), and Caste Certificate (original), an Id Proof (Aadhar Card/Voter Card) and call letter along with filled up Bio-Data as attached with it.</span></strong></p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 24.0pt; mso-bidi-font-size: 20.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></strong></p>\r\n<p>&nbsp;</p>', '2019-05-30');
