(399, 'Chemistry B.Sc. Semester II (General) Practical Examination-2019', '<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 18.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;</span><span style=\"mso-spacerun: yes;\">&nbsp;T</span></span></strong><span lang=\"EN-US\" style=\"font-size: 18.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">his is to notify that B.Sc. 2<sup>nd</sup> Semester CEMG (General) Practical CC2 P Examination-2019 of Calcutta University at Bangabasi Evening College Centre will be held on 24.06.2019. The exam will commence from <strong>2.30 pm</strong> onwards. Come at 2pm sharp with <strong>Admit card and Lab Note Book.</strong></span></p>', '2019-06-22'),
(400, 'Admit Cards of BSc (Hons and Gen) CBCS system Sem 2 ', '<p><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Admit Cards of BSc (Hons and Gen) CBCS system</span></strong> Sem 2 for CU 2019&nbsp; for Practical Exam would be issued from 1<sup>st</sup> floor office on 10.6.19 only. Hons Pract Exam date will start from 11.6.19. Students are instructed to contact their HOD for Date and Place of Exam. <br /></span></strong></p>', '2019-06-07'),
