(403, 'Admission for Reserved Seats', '<p class=\"MsoNormal\">Some SC, ST, OBCA, OBCB and Physically Handicapped seats of the following subjects remain vacant for UG Admission 2019-20 session. Applications are invited online within 25.6.19</p>\r\n<p class=\"MsoNormal\">Subjects: <span style=\"font-size: 10.0pt; mso-bidi-font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-font-kerning: 12.0pt;\">Honours Course in Bengali, English, Hindi, History, Political Science, Sanskrit, Philosophy, Chemistry, Mathematics, Anthropology, Economics, Physiology, Botany and Accountancy<span style=\"color: black;\">. Also, BA Gen, BSc Gen Bio, BSc Gen Pure, and BCom Gen.</span></span></p>', '2019-06-21');
