es New Roman\'; color: red; background: #F9F9F9;\">&rsquo;</span><strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; color: #ff2b2b; background: #F9F9F9;\"><a href=\"http://bangabasieveningcollege.in/online_application/AdmissionList.php\" target=\"_blank\"><span style=\"color: #d50000;\">Merit List&rsquo; </span></a>&nbsp;</span></strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">will be published in the College webpage on 26.6.19, 8.00 pm.&nbsp; Last date of Admission is 28.6.19 (12.00AM). Fill up the form through <a href=\"http://bangabasieveningcollege.in/online_application-56789000/\" target=\"_blank\"><span style=\"color: black; mso-themecolor: text1;\">\"</span><span style=\"color: #1f497d; mso-themecolor: text2;\">Apply Online for UG Courses (2019-2020)</span><span style=\"color: black; mso-themecolor: text1;\">\"</span></a>&nbsp;. Click upon &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">Pay Admission Fees Online</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo; then Pay &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1<sup>st</sup> Year Admission Form</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo;</span> <span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">by clicking. </span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; color: black; background: #F9F9F9;\">Vide \"<a style=\"box-sizing: border-box; text-decoration-line: none; transition: all 0.5s ease 0s;\" href=\"../img/Admission_Guideline.pdf\" target=\"_blank\"><span style=\"color: #2fa4e7;\">Admission Guideline for UG Courses\"</span></a><span style=\"box-sizing: border-box;\">&nbsp;&nbsp;</span>for rules of Admission in the webpage</span>. <span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">After appearing in the </span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; background: #F9F9F9;\">&lsquo;</span><strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; color: #ff2b2b; background: #F9F9F9;\"><a href=\"http://bangabasieveningcollege.in/online_application/AdmissionList.php\" target=\"_blank\"><span style=\"color: #d50000;\">Merit List&rsquo; </span></a></span></strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">pay Required amount for each subject according to Drop Down Menu starting with &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1st Year</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">..&rdquo;, e.g., &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1<sup>st</sup> Year BA H in English</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo;, by putting your Application No as appeared in your Admission Form. The candidates whose names have appeared in the first merit list, but could not get provisionally admitted within 15.6.19 may get a chance to revalidate the previous application form by depositing Rs 200/- by clicking on &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1<sup>st</sup> Year Admission Form</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo;</span> <span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">in favor <span style=\"mso-spacerun: yes;\">&nbsp;</span>of the old Application No. All Classes will start tentatively in 1<sup>st</sup> to 2<sup>nd</sup> week of July 2019. Candidates will be called in specific dates (subject-wise) for verification of Form, Mark sheet, Admit etc. with their original one in this Notice Box. </span></p>\r\n<p>&nbsp;</p>', '2019-06-21'),
(405, 'B.A/B.Sc/B.Com (1+1+1 System) Part-I (Hons & Gen) Online Form Fill-up For C.U Examination 2019.      ', '<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Courier New\';\">All 1st year B.A/B.Sc/B.Com (Hons and General) (1+1+1system) regular and casual students who are appearing in the C.U Examination 2019 are informed to submit their examination form online&nbsp;</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Courier New\';\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Bookman Old Style\',\'serif\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"> from: 20.6.2019 to 25.6.2019</span></span></strong>.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Courier New\';\">Web site: </span></strong><a href=\"http://www.cuexam.net\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Courier New\';\">www.cuexam.net</span></strong></a></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 134.7pt; text-align: justify; text-justify: inter-ideograph;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Courier New\';\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Courier New\';\">After entering the site go to student option and put the Registration number in box. The form will appear with your all details, check the form (Photo, Name, Subjects etc)and take print out and meet 1<sup>St</sup> floor office.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Courier New\';\">Note:</span></span></strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Courier New\';\"> 1) All candidates are asked to bring with their Registration certificate, Fees books, Library clearance, Tuition fees paid up to June 2019.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 150%; tab-stops: 42.55pt;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Courier New\';\">2) It may be noted that if any student(s) unable to submit CU Form to the college office <span style=\"text-decoration: underline;\">within schedule</span>, the college authority will not be responsible for not approval. After last date, the college authority unable to approved their candidature through CU website portal.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 22.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Algerian;\">&nbsp;</span></p>', '2019-06-20');
