ommence from 5<sup>th</sup> July 2019. <span style=\"mso-spacerun: yes;\">&nbsp;</span>Verification of Mark-sheet etc. for confirming Admission will be held on 5-6<sup>th</sup> July, 2019 for BCom Hons and Gen, 8-9<sup>th</sup> July, 2019 for BA Hons and Gen; 10-11<sup>th</sup> July2019, for BSc Hons and Gen from 5.30 to 8.30pm. Students must bring the following documents in original for verification.</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Higher Secondary Mark-sheet (Original)</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Madhyamik Admit Card or certificate for Age Proof (Original)</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Caste Certificate from West Bengal Government (Original), if any.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Aadhar Card (Original)</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">5.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">School leaving Certificate (Original)</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">6.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Migration Certificate (Original) for other State Boards</span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">7.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Handicapped Certificate, if any</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Candidates must be <span style=\"color: red;\">physically present before Verification Board</span> for confirmation of Admission. They must submit the following documents to the office at the time of verification:</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -18.0pt; mso-list: l1 level1 lfo2;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Downloaded Application form with candidate&rsquo;s signature in ink</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18.0pt; mso-list: l1 level1 lfo2;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Higher Secondary Mark-sheet (Xerox)</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18.0pt; mso-list: l1 level1 lfo2;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 14.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Madhyamik Admit Card or certificate for Age Proof (Xerox)</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-in