INSERT INTO `noticeboard` (`id`, `notice_subject`, `notice`, `publish_dt`) VALUES
(411, 'Merit List For 3rd Phase Admission', '<p>&nbsp;</p>\r\n<table class=\"table table-striped table-bordered bootstrap-datatable datatable responsive\" style=\"box-sizing: border-box; border-collapse: collapse; border-spacing: 0px; width: 648px; max-width: 100%; margin-bottom: 20px; border: 1px solid #dddddd; font-family: \'Helvetica Neue\',Helvetica,Arial,sans-serif; height: 45px;\">\r\n<tbody style=\"box-sizing: border-box;\">\r\n<tr style=\"box-sizing: border-box;\">\r\n<td style=\"box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid #dddddd; background-color: #f9f9f9;\">&nbsp;</td>\r\n<td style=\"box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid #dddddd; background-color: #f9f9f9;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; background: #F9F9F9;\">3rd Phase Admission for the session 2019-20 </span></strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">is going on. Last Date of Application is 2.7.19 (12am).</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; background: #F9F9F9;\">&rsquo;</span><strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; color: #ff2b2b; background: #F9F9F9;\"><a href=\"http://bangabasieveningcollege.in/online_application/AdmissionList.php\" target=\"_blank\"><span style=\"color: #d50000;\">Merit List&rsquo; </span></a>&nbsp;</span></strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">will be published in the College webpage on 3.7.19, 8.00 pm.&nbsp; Last date of Admission is 5.7.19 (12.00am). Fill up the form through <a href=\"http://bangabasieveningcollege.in/online_application-56789000/\" target=\"_blank\"><span style=\"color: black; mso-themecolor: text1;\">\"</span><span style=\"color: #1f497d; mso-themecolor: text2;\">Apply Online for UG Courses (2019-2020)</span><span style=\"color: black; mso-themecolor: text1;\">\"</span></a>&nbsp;. Click upon &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">Pay Admission Fees Online</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo; then Pay &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1<sup>st</sup> Year Admission Form</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo;</span> <span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">by clicking. F</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; color: black; background: #F9F9F9;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; color: black; background: #F9F9F9;\">or rules of Admission</span> Vide \"<a style=\"box-sizing: border-box; text-decoration-line: none; transition: all 0.5s ease 0s;\" href=\"../img/Admission_Guideline.pdf\" target=\"_blank\"><span style=\"color: #2fa4e7;\">Admission Guideline for UG Courses\"</span></a>in the webpage</span>. <span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">After appearing in the </span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; background: #F9F9F9;\">&lsquo;</span><strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; color: #ff2b2b; background: #F9F9F9;\"><a href=\"http://bangabasieveningcollege.in/online_application/AdmissionList.php\" target=\"_blank\"><span style=\"color: #d50000;\">Merit List&rsquo; </span></a></span></strong><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">pay Required amount for each subject according to Drop Down Menu starting with &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1st Year</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">..&rdquo;, e.g., &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1<sup>st</sup> Year BA H in English</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo;, by putting your Application No as appeared in your Admission Form. The candidates whose names have appeared in the first or second merit list, but could not get provisionally admitted within 15.6.19 and 28.6.19 respectively, may get a chance to revalidate their previous application form by depositing Rs 200/- by clicking on &ldquo;</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #1f497d; mso-themecolor: text2; background: #F9F9F9;\">1<sup>st</sup> Year Admission Form</span></span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">&rdquo;</span> <span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; background: #F9F9F9;\">in favor <span style=\"mso-spacerun: yes;\">&nbsp;</span>of the old Application No. All Classes will start from 5th July 2019. Candidates have been called in specific dates (subject-wise) for verification of Form, Mark sheet, Admit etc. with their original one as already announced in this Notice Box. </span></p>\r\n<p>&nbsp;</p>', '2019-06-29');
